import React, {Component} from 'react';

class Footer extends Component{

    render(){
        
        return(
            <footer id="footer">
                <div className="center">
                    <p>&copy; Curso de React - By: Alvaro Escobar</p>
                </div>
            </footer>
        );
    }

}

export default Footer;
